  overworldMap() {
    _maxPX = world[0].length;
    _maxPY = world.length;
  }
  
  int getTileIdByPos(int px, int py) {
    if (px >= 0 && px < _maxPX && py >= 0 && py < _maxPY) {
      return world[py][px];
    }
    return 0; // ocean
  }
  
  int getImageSrcPx(int tileId) {
    return (tileId % 10).toInt() * _srcTileSize;
  }
  
  int getImageSrcPy(int tileId) {
    return (tileId / 10).toInt() * _srcTileSize;  
  }
  
  bool isPassable(int tileId) {
    return stats.isPassableTerran(tileId);
  }
